import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from 'redux'

import { initScene } from '../reducer/webscene/actions'

interface ViewProps {
  init: Function,
  websceneId: string
}

export class WebSceneView extends React.Component <ViewProps, { }> {
  componentDidMount() {
    if (this.props.websceneId) {
      this.props.init(this.sceneView.current, this.props.websceneId)
    }
  }

  //sceneView = React.createRef<HTMLDivElement>();
  render() {
    return (
      <div className="websceneview" ref={(ref) => {this.sceneView = ref;}} />

        //this.sceneView} />
    )
  }
}

function mapDispatchToProps(dispatch: any) {
  return {
    init: bindActionCreators(initScene, dispatch),
  }
}

export default connect(null, mapDispatchToProps)(WebSceneView)
